#!/bin/bash

set -e

NODE="$1"
if [ -z "$NODE" ]; then
    NODE=/node
fi
if ! [ -d "$NODE" ]; then
    >&2 echo "Error: $NODE is not a directory"
    >&2 echo "Usage: $0 [node dir]"
    exit 1
fi

# From scripts/data/dn-12614506.fix
FIX=""

dbrepair applyFix <(echo $FIX | base64 -d) "$NODE/dnn/data/accumulate.db"
tendermint rollback --home "$NODE/dnn"; echo
tendermint set-app-version 1 --home "$NODE/dnn"
